import React from "react";

const Table2 = () => {
  const data = [
    { category: "Alpha", value: 30 },   // A5 + A20
    { category: "Beta", value: 16 },    // A15 / A7
    { category: "Charlie", value: 270 } // A13 * A12
  ];

  return (
    <div className="table-container">
      <h2>Table 2</h2>
      <table>
        <thead>
          <tr>
            <th>Category</th>
            <th>Value</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row) => (
            <tr key={row.category}>
              <td>{row.category}</td>
              <td>{row.value}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Table2;
